// src/App.js
import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";

import Layout from "./Layout";
import LoginPage from "./pages/LoginPage";
import DashboardPage from "./pages/DashboardPage";
import FirewallRulesPage from "./pages/FirewallRulesPage";
// ... diğer importlar (LogsPage vs.)

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/login" element={<LoginPage />} />

        {/* Layout'lu korunan rotalar */}
        <Route
          path="/"
          element={
            <Layout>
              <DashboardPage />
            </Layout>
          }
        />
        {/* ... diğer sayfalar ... */}

        {/* Firewall Rules sayfası */}
        <Route
          path="/firewall-rules"
          element={
            <Layout>
              <FirewallRulesPage />
            </Layout>
          }
        />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
